import React from 'react';
import { Card } from 'react-bootstrap';

interface StatisticsProps {
    symbol?: string;
    name?: string;
    price?: string;
    change?: string;
    percent_change?: string;
};

const StatisticsWidget = ({ symbol, name, price, change, percent_change }: StatisticsProps) => {
    let img_url = "https://storage.googleapis.com/iex/api/logos/" + symbol + ".png";
    return (
        <Card className="text-center">
            <img src={img_url} alt="showing stock symbol" />
            <Card.Title className="card-title">{name}</Card.Title>
            <Card.Subtitle className="text-muted">{price}</Card.Subtitle>
            <Card.Body className="card-body">
                {symbol} and {change} and {percent_change}
            </Card.Body>
        </Card>
    );
};

export default StatisticsWidget;
